var express = require("express");
var app = express();

var bodyParser = require("body-parser");
app.use(bodyParser.urlencoded({extended: true}));

app.set("view engine", "ejs");

var campgrounds = [
    {name:"Camp1", image: "data:image/jpeg;base64,"},
    {name:"Camp2", image: "data:image/jpeg;base64,"},
    {name:"Camp3", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTM2i-6QSbUSKbiqZf5gDTCbafjK0qq49NGyg&usqp=CAU"},
    {name:"Camp1", image: "data:image/jpeg;base64,"},
    {name:"Camp2", image: "data:image/jpeg;base64,"},
    {name:"Camp3", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTM2i-6QSbUSKbiqZf5gDTCbafjK0qq49NGyg&usqp=CAU"},{name:"Camp1", image: "data:image/jpeg;base64,"},
    {name:"Camp2", image: "data:image/jpeg;base64,"},
    {name:"Camp3", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTM2i-6QSbUSKbiqZf5gDTCbafjK0qq49NGyg&usqp=CAU"}
];

app.get("/", function(req, res)
{
   res.render("landing"); 
});

app.get("/campgrounds", function(req, res)
{
   res.render("campgrounds", {campgrounds: campgrounds}); 
});

app.post("/campgrounds", function(req, res)
{
    var newCampground = {name: req.body.name, image: req.body.image};
    campgrounds.push(newCampground);
    res.redirect("/campgrounds");
});

app.get("/campgrounds/new", function(req, res) 
{
    res.render("new");    
});

app.listen(process.env.PORT, process.env.IP, function()
{
    console.log("The YelpCamp Server has been started!!"); 
});